('1945','18','2211','Doppelhaushälfte Pedersen',Null,'Neue Doppelhaushälfte auf La Mola in Port d´Andratx','24630','Diese Doppelhaushälfte wurde 2009 erstellt und befindet sich im Neubauzustand. Die ca. 135 m² Wohnfläche verteilt sich auf 3 Etagen. Im Erdgeschoss befinden sich die Poolterrasse mit kleinem Poolbecken, das Wohnzimmer, eine offene Küche mit Esstisch, ein WC und ein sonniges Patio.\r\nIm ersten Obergeschoss liegen 2 Schlafzimmer mit 2 Badezimmern und im 2. Obergeschoss ein weiteres Schlafzimmer mit Badezimmer. Von der Tiefgarage (ein Stellplatz) hat man einen direkten Zugang über den Hauswirtschaftsraum zum Haus.\r\nZur modernen Ausstattung gehören Aluminium-Doppelglasfenster, Kamin, Klimaanlage w/k und eine Einbauküche. Das Haus wird möbliert vermietet.','24631','2500','111','2013-01-30 11:36:34','106','2013-01-30 11:37:11',Null,'1694','166','816',1,'1','0',Null,Null,'auf Anfrage','24632',Null,'0','0','0',Null,'2015-07-03 14:48:23',1,'0',Null,Null,Null,Null,'5',1,1,1,'0','1','1',1,1,Null,'24633',Null,'24634',Null,'24635',Null,'24636',Null,'24637','0',0,'0');
